// SPDX-License-Identifier: MIT
pragma solidity 0.8.1;

import "@openzeppelin/contracts/utils/Counters.sol";

contract GeekNft {

  event Transfer(address indexed _from, address indexed _to, uint256 _tokenId);

    string name;
    string symbol;
    address owner;
    struct Item{
        uint dataId;
        uint tokenId;
        uint price;
        bool toSell;
    }
    Item[] items;
    uint itemsToSellCount;
    uint createItemFees = 0.00025 ether;
    uint creatorPercentage = 5;

    mapping(address => uint) itemsOwnerCount;
    mapping(uint => address) itemToOwner;

    mapping(address => uint) itemsCreatorCount;
    mapping(uint => address) itemToCreator;

    mapping(uint => uint) itemsCatIdCount;
    mapping(uint => uint) itemToCatId;

    constructor() {
        owner = msg.sender;
        name = "Geek Tokens";
        symbol = "GEEKT";
    }

    modifier onlyContractOwner() {
        require(msg.sender == owner, "Only contract's owner can do that");
        _;
    }

    modifier onlyItemOwner(uint _tokenId) {
        require(itemToOwner[_tokenId] == msg.sender, "Only item's owner can do that");
        _;
    }

    modifier sendCorrectFeesValue() {
        require(msg.value == createItemFees, "Thanks to send correct fees value");
        _;
    }

    function updateCreateItemFees(uint _newFees) public onlyContractOwner{
        createItemFees = _newFees;
    }

    function getCreateItemFees() public view returns (uint) {
        return createItemFees;
    }

    function updateCreatorPercentage(uint _newPercentage) public onlyContractOwner{
        creatorPercentage = _newPercentage;
    }

    function getCreatorPercentage() public view returns (uint) {
        return creatorPercentage;
    }

    function mint(uint _price, uint _catId, uint _dataId) public payable sendCorrectFeesValue returns (uint){
        require(_price > 0, "Price cannot be equal to 0");
        uint newTokenId = items.length;

        require(itemToOwner[newTokenId] == address(0), "token already exist");

        items.push(Item(_dataId, newTokenId, _price, true));
        itemToOwner[newTokenId] = msg.sender;
        itemToCreator[newTokenId] = msg.sender;
        itemToCatId[newTokenId] = _catId;

        unchecked{
            itemsOwnerCount[msg.sender]++;
            itemsCreatorCount[msg.sender]++;
            itemsCatIdCount[_catId]++;
            itemsToSellCount++;
        }
        payable(owner).transfer(msg.value);
        return newTokenId;
    }

    function sellItem(uint _tokenId) public payable{
        require(msg.value == items[_tokenId].price, "transaction's value cannot be different of item price");
        require(itemToOwner[_tokenId] != address(0), "token doesn't exist");
        require(itemToOwner[_tokenId] != msg.sender, "you can't buy an item that belongs to you");

        address oldOwner = itemToOwner[_tokenId];

        Item storage itemToSell = items[_tokenId];
        itemToSell.toSell = false;

        itemToOwner[_tokenId] = msg.sender;

        unchecked{
            itemsOwnerCount[oldOwner]--;
            itemsOwnerCount[msg.sender]++;
            itemsToSellCount--;
        }

        if(itemToCreator[_tokenId] == oldOwner){
            payable(oldOwner).transfer(msg.value);
        } else {
            uint fees;
            uint totalMinusFees;
            (fees, totalMinusFees) = getFees(msg.value, creatorPercentage);
            payable(itemToCreator[_tokenId]).transfer(fees);
            payable(oldOwner).transfer(totalMinusFees);
        }

        emit Transfer(oldOwner, msg.sender, _tokenId);
    }

    function ownerOf(uint _tokenId) public view returns (address){
        return itemToOwner[_tokenId];
    }

    function balanceOf(address _owner) public view returns (uint){
        return itemsOwnerCount[_owner];
    }

    function removeItemToSell(uint _tokenId) public onlyItemOwner(_tokenId) {
        require(itemToOwner[_tokenId] != address(0), "token doesn't exist");
        require(items[_tokenId].toSell == true, "token isn't to sell");
        items[_tokenId].toSell = false;
        unchecked{
            itemsToSellCount--;
        }
    }

    function addItemToSell(uint _tokenId) public payable sendCorrectFeesValue onlyItemOwner(_tokenId) {
        require(itemToOwner[_tokenId] != address(0), "token doesn't exist");
        require(items[_tokenId].toSell == false, "token is already to sell");
        items[_tokenId].toSell = true;
        unchecked{
            itemsToSellCount++;
        }
        payable(owner).transfer(msg.value);
    }

    function fetchItemByDataId(uint _dataId) public view returns (Item memory){
        Item memory item;
        for(uint i = 0; i < items.length; i++) {
            if(items[i].dataId == _dataId){
                item = items[i];
                break;
            }
        }
        return item;
    }

    function fetchItemsToSell() public view returns (Item[] memory){
        uint counter = 0;
        Item[] memory result = new Item[](itemsToSellCount);

        for(uint i = 0; i < items.length; i++) {
            if(items[i].toSell == true){
                result[counter] = items[i];
                counter++;
            }
        }

        return result;
    }

    function fetchItemsByOwner() public view returns (Item[] memory){
        uint counter = 0;
        Item[] memory result = new Item[](itemsOwnerCount[msg.sender]);

        for(uint i = 0; i < items.length; i++) {
            if(itemToOwner[i] == msg.sender){
                result[counter] = items[i];
                counter++;
            }
        }

        return result;
    }

    function fetchItemsByCreator() public view returns (Item[] memory){
        uint counter = 0;
        Item[] memory result = new Item[](itemsCreatorCount[msg.sender]);

        for(uint i = 0; i < items.length; i++) {
            if(itemToCreator[i] == msg.sender){
                result[counter] = items[i];
                counter++;
            }
        }

        return result;
    }

    function fetchItemsToSellByCatId(uint _catId) public view returns (Item[] memory){
        uint counter = 0;
        Item[] memory result = new Item[](itemsCatIdCount[_catId]);

        for(uint i = 0; i < items.length; i++) {
            if(itemToCatId[i] == _catId && items[i].toSell == true){
                result[counter] = items[i];
                counter++;
            }
        }

        return result;
    }

    /////////////////// privates methods //////////////////////

    function getFees(uint _price, uint _percentage) private pure returns (uint, uint){
        uint fees = (_percentage * _price) / 100;
        uint totalMinusFees = _price - fees;
        return (fees, totalMinusFees);
    }

}

